import PropTypes from 'prop-types';
import Modal from '../../shared/Modal/Modal';
import Input from '../../shared/Input/Input';

const CreateConfigurationModal = props => {
    const {
        isVisible,
        showNewConfigurationModal,
        closeNewConfigurationModal,
        okNewConfigurationModal,
        cancelNewConfigurationModal,
    } = props;

    return (
        <Modal
            isVisible={isVisible}
            showModal={showNewConfigurationModal}
            closeModal={closeNewConfigurationModal}
            onOk={okNewConfigurationModal}
            onCancel={cancelNewConfigurationModal}
        >
            <Input type={'text'} placeholder={'Name'} />
        </Modal>
    );
};

CreateConfigurationModal.propTypes = {};

export default CreateConfigurationModal;
